('2233','2','8228','Wohnung Zins',Null,'Zwei sehr schöne neue Wohnungen in Palma ','31659','Dieses 2 neue 1 Schlafzimmer Wohnungen werden zurzeit erstellt und befinden sich in der Nähe der Bar Bosch und Paseo Borne in Palma de Mallorca.\r\nDie 1. Wohnung liegt im EG mit einer Wohnfläche von 55m² die sich auf ein Wohn-Esszimmer mit Küchenzeile, 1 Badezimmer und ein Schlafzimmer aufteilt.\r\nDes Weiteren bietet diese Wohnung noch einen Innenpatio mit ca  40m².\r\nDer Preis liegt bei 355.000€\r\nDie 2. Wohnung liegt im Hochpaterre und hat ca. 77m² und bietet die gleiche Aufteilung wie die 1. Wohnung ohne Patio.\r\n\r\n\r\n','31660','295000','106','2014-07-15 12:13:23','110','2014-07-15 12:14:18',Null,'2207','105','818',1,'1','0',Null,Null,Null,'31661',Null,'0','0','0',Null,'2015-04-20 15:35:28',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31662',Null,'31663',Null,'31664',Null,'31665','termin  639 632 707   639 631 661','31666','0',0,'5');
